const ContactData = [];
const contactReducer = (state = { Contacts }, action) => {
  switch (action.type) {
    case "ADD-Contact":
      return {
        ContactData: state.ContactData(...ContactData.concat(action.payload)),
      };

    default:
      break;
  }
};
export default contactReducer;
